{
  "advertisements": [
    {
      "date": "1764-03-20",
      "tags_section": "Anzeigen",
      "text": "16. Bey Herrn, Hudolf Ramsperger an der Huth, so if extra gute Holder-Lebad in Hevern finden läßt. Nichts als 10 Bögen, wie auch außer Et. Unzent à 8 Ps. in haben."
    },
    {
      "date": "1764-03-20",
      "tags_section": "Anzeigen",
      "text": "17. Bo guter Net grobe Behen um Erben, und eine neue weiße Bito zum Kochen in billigen Preisen in haben, wenn im Berichthaus ohne Entgelt zu erlangen."
    },
    {
      "date": "1764-03-20",
      "tags_section": "Anzeigen",
      "text": "18. Sieben Barrelein oder Brofsiffer, Huths, wie auch ein gans neuer Calfor's Huth, mittelnagiger Obbe, im Berichthaus in erlangen."
    },
    {
      "date": "1764-03-20",
      "tags_section": "Anzeigen",
      "text": "19. Bey Herrn, Burthebst zum Kaufen find extra neue grobe Holderische Feigen, die große Nectrauben mit und obene Etitel, Safianuh, drei Morcheln, feiner Chocoladen, alles in billigen Preis zu haben."
    },
    {
      "date": "1764-03-20",
      "tags_section": "Anzeigen",
      "text": "20. Sehr Edle neue Waizen in billigen Preis, im Berichthaus ohne Entgelt zu erlangen."
    },
    {
      "date": "1764-03-20",
      "tags_section": "Anzeigen",
      "text": "21. Bey Herrn, Jacob Grimm, Buchbinder in der Stadt, ein stärks Atlas von der Land-Karten, Charten, Blans von Italien und Blanserungen der besten Kriegh. 2.) Die Welt in einer Kuff mit Kupfer. 3.) Die Durchlauchigste Belt. 4.) Schulf mit Waopen. 4.) Journal du camp de Compiegne avec figures."
    },
    {
      "date": "1764-03-20",
      "tags_section": "Anzeigen",
      "text": "22. Zwei andere freundliche Brüder in ein Geburt-Haus aus dem Landt oder in ein Bad dienerlich, besonders im Berichthaus zu erlangen."
    },
    {
      "date": "1764-03-20",
      "tags_section": "Anzeigen",
      "text": "23. Eine Beruhigung in der Nebenste Nöthigkeit mit 4 Stuben, 5 Kammern, und eine große und einen schönen Garten, sehr wohl bequem, Herr. Jacob Wilhelm den Weinmann aus dem Land."
    },
    {
      "date": "1764-03-20",
      "tags_section": "Anzeigen",
      "text": "24. Ein Grund, welcher circa 600 Saecker Haunf, Saamen und hefern Lohnte, möchte aber wohl verborgen verstattet werden, außer wenn gute Böber in billigen Preis, im Berichthaus zu erlangen."
    },
    {
      "date": "1764-03-20",
      "tags_section": "Anzeigen",
      "text": "25. Bo guter alter weiser Mann in haben, wenn den Ritt. Michael Fuchs den Riefer zu vernehmen."
    },
    {
      "date": "1764-03-20",
      "tags_section": "Anzeigen",
      "text": "26. Etra 6. Es wird extra gut alter your rothe Pfeffener. Wein, so gut als Steinenburger der Burgunder, in billigen Preis, im Berichthaus zu erlangen."
    },
    {
      "date": "1764-03-20",
      "tags_section": "Anzeigen",
      "text": "27. Zwei Stiefelweisn beim Ben non 1760. 8 Fund zu 8 Saum im unten; und 8 Fund im oben, wenn nach Beichen in haben; im Berichthaus ohne Entgelt zu erlangen."
    },
    {
      "date": "1764-03-20",
      "tags_section": "Anzeigen",
      "text": "28. Ein Sted Haus ab 6 Thannen Matten vorn Richmer, vor bequahlich ber Scherebreut, Armer ein Ertlichen von 7 Saumen reiten Böller, wenn von 760. auch rund lauter, im Berichthaus ohne Entgelt zu erlangen."
    },
    {
      "date": "1764-03-20",
      "tags_section": "Anzeigen",
      "text": "29. Nuf E. E. Zunft um Bieren hat widrum neue Saure Rüben in billigen Preis zu haben."
    },
    {
      "date": "1764-03-20",
      "tags_section": "Anzeigen",
      "text": "30. Ein recht Scharbachen Gambold und Hofen in billigen Preis, im Berichthaus zu erlangen."
    },
    {
      "date": "1764-03-20",
      "tags_section": "Anzeigen",
      "text": "31. Im Difenburger Hof if wohlvermählte Bau zu haben."
    },
    {
      "date": "1764-03-20",
      "tags_section": "Anzeigen",
      "text": "32. Ein Breunhauledten bei der Stinen-Wilhin mit aller Kommlichkeit, im Berichthaus ohne Entgelt zu erlangen."
    },
    {
      "date": "1764-03-20",
      "tags_section": "Anzeigen",
      "text": "33. Bey einer rechter und weiser Burgunder / wie auch Musikts-Wein, Bicenwein wegen Mandel Mages, wie auch Roth und weiße 4-5-zeige Margrefter Wein in billigen Preis zu haben, wenn im Berichthaus ohne Entgelt zu erlangen."
    },
    {
      "date": "1764-03-20",
      "tags_section": "Anzeigen",
      "text": "34. Keine heitragliche Humberger Ertref-Molten das Mahn zu 6 Fund, wo deiche Münzwert in haben, wenn im Berichthaus ohne Entgelt zu erlangen."
    },
    {
      "date": "1764-03-20",
      "tags_section": "Anzeigen",
      "text": "35. Sehrn Holach des Eigrisfis Beruhung in Spieglsglain mit 4 Stuben, 5 Kammern etc. it entzahlt zu verlangen, oder lamahaft zu verletten."
    },
    {
      "date": "1764-03-20",
      "tags_section": "Anzeigen",
      "text": "36. Weiße und rothe Margrefter, Beine von 1760. werden in billigen Preis nach Beichen zu haben, im Berichthaus zu erlangen."
    },
    {
      "date": "1764-03-20",
      "tags_section": "Anzeigen",
      "text": "37. Ein Pemenst in St. Peter's Kirch auf dem Leitner, wenn ein grün Tombon-Bethein mit grünen weissen Limpungen, in billigen Preis, im Berichthaus zu erlangen."
    },
    {
      "date": "1764-03-20",
      "tags_section": "Anzeigen",
      "text": "38. Ein Hausschlittten mit einem schönen Bith und Zugehört in billigen Wert, im Berichthaus in erlangen."
    },
    {
      "date": "1764-03-20",
      "tags_section": "Anzeigen",
      "text": "39. Der Barmeister, Hof und Et. Peter, mit Gästen, Stälen, Kochen it wie bei Nigenus sein sollen wird. Zu Ermanlung eines Kaufers"
    }
  ]
}
